import {
    SetupFunctionalContent,
    SetupFunctionalContainer,
    SetupHeroContainer,
    SetupStepIcon,
    SetupWrapper
} from "../styled/Setup.styled.css";
import {LoginSubtitle, LoginTitle} from "../styled/Login.styled";
import {GoogleLogin, GoogleOAuthProvider} from '@react-oauth/google';
import jwt_decode from "jwt-decode";

function Login() {
    return (
        <SetupWrapper>
            <SetupFunctionalContainer>
                <SetupFunctionalContent>
                    <SetupStepIcon className="bi bi-house-door"></SetupStepIcon>
                    <LoginTitle>Identifiez-vous en un clic !</LoginTitle>
                    <LoginSubtitle>Clac ! En un claquement de doigts !</LoginSubtitle>
                    <GoogleOAuthProvider clientId="910646973872-96rfc0oggtrqsi4i3u0f9g5ricd11p1n.apps.googleusercontent.com">
                        <GoogleLogin
                            onSuccess={credentialResponse => {
                                console.log(jwt_decode(credentialResponse.credential));
                            }}
                            onError={() => {
                                console.log('Login Failed');
                            }}
                        />
                    </GoogleOAuthProvider>
                </SetupFunctionalContent>
            </SetupFunctionalContainer>
            <SetupHeroContainer>

            </SetupHeroContainer>
        </SetupWrapper>
    );
}

export default Login;
